package Practice;

public class Numberseries {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=1;i<100;i++)
		{
			if(i%11==0&&i<100)
			{
				System.out.println(i);
			}
		}
		for(int i=1;i<1000;i++)
		{
			if(i%111==0&&i<1000)
			{
				System.out.println(i);
			}
		}
	}

}
